  return (
    <div className="header__preview">
      <h1>DOM1STORE</h1>
      <div className="header__contact">
        <p>Бесплатно по УК</p>
        <p>+38 (067) 432-43 </p>
      </div>
      <div className="header__search">
        <input />
      </div>
    <div c></div>
      <div className="header__work">
        <button>
          <img src={like} alt="sd" />
        </button>
        <button>
          <img src={shop} alt="sd" />
        </button>
        <button>
          <img src={stat} alt="sd" />
        </button>
      </div>
    </div>
  );
}

export default Header;
